import React from 'react';
import '../style/components.scss'
import { Card, Icon } from 'semantic-ui-react';

interface workcardProps {
    company: string;
    ingress: string;
    who: string;
    goal: string;
    results: string;
}

class Workcard extends React.Component<workcardProps, {}> {

    i : number = 0;

    render() {
        return <div className="workcard">
            <Card fluid>
                <Card.Content header={this.props.company} textAlign="left" />
                <Card.Content description={this.props.ingress} />
                <Card.Content>
                    <p className={"mini-title"}>Who?</p>
                    <p>
                        {this.props.who}
                    </p>
                    <p>
                        {this.props.goal}
                    </p>
                    <p>
                        {this.props.results}
                    </p>
                </Card.Content>
                <Card.Content extra>
                    <Icon name='user' />See more
                </Card.Content>
            </Card>
        </div>;
    }
}

export default Workcard;
